(15326, 47372, NULL, 'Andrew just rang - he was very disappointed with his moves. He had booked in one move from Chatswood with 3 men and another from The Rocks with 2 men. Chris  sent 2 trucks + 4 men to The Rocks instead of 3 men + truck to Chatswood. Chris told Andrew (and me) that a 3rd man would meet them in Chatswood. Andrew didn\'t find out until 3 or 4 hours in that Chris only had 2 men. (We didn\'t find out till the job sheet came in). Chris told Andrew that he made the call that it wasn\'t a big job and only 2 guys were needed. Andrew also said the second truck was too small and he had to hire another truck.\r\nHe had to be out of The Rocks by 10am. He didn\'t tell us that but said that\'s why he booked the truck for 7:30. The guys were late and started at 8am.\r\nHe said the packing ladies and office staff were all fantastic. He\'s sending an email hoping for compensation for truck hire.', '', '2019-04-11 16:22:25', 0, 1, 5, 'Jen'),
(15327, 47373, NULL, 'Andrew just rang - he was very disappointed with his moves. He had booked in one move from Chatswood with 3 men and another from The Rocks with 2 men. Chris  sent 2 trucks + 4 men to The Rocks instead of 3 men + truck to Chatswood. Chris told Andrew (and me) that a 3rd man would meet them in Chatswood. Andrew didn\'t find out until 3 or 4 hours in that Chris only had 2 men. (We didn\'t find out till the job sheet came in). Chris told Andrew that he made the call that it wasn\'t a big job and only 2 guys were needed. Andrew also said the second truck was too small and he had to hire another truck.\r\nHe had to be out of The Rocks by 10am. He didn\'t tell us that but said that\'s why he booked the truck for 7:30. The guys were late and started at 8am.\r\nHe said the packing ladies and office staff were all fantastic. He\'s sending an email hoping for compensation for truck hire.', '', '2019-04-11 16:22:31', 0, 1, 5, 'Jen'),
